class CategoriesModel {
  CategoriesModel({
    this.nextStart,
    this.topicCount,
    this.topics,
    this.tids,
    this.title,
    this.breadcrumbs,
    this.canPost,
    this.showSelect,
    this.showTopicTools,
    this.allCategoriesUrl,
