    this.relativePath,
    this.template,
    this.url,
    this.bodyClass,
    // this.header,
    this.widgets,
  });

  CategoriesModel.fromJson(dynamic json) {
    nextStart = json['nextStart'];
    topicCount = json['topicCount'];
    if (json['topics'] != null) {
      topics = [];
      json['topics'].forEach((v) {
        topics?.add(Topics.fromJson(v));
      });
    }
    tids = json['tids'] != null ? json['tids'].cast<num>() : [];
    title = json['title'];
    if (json['breadcrumbs'] != null) {
      breadcrumbs = [];
      json['breadcrumbs'].forEach((v) {
        breadcrumbs?.add(Breadcrumbs.fromJson(v));
      });
    }
    canPost = json['canPost'];
    showSelect = json['showSelect'];
    showTopicTools = json['showTopicTools'];
    allCategoriesUrl = json['allCategoriesUrl'];
    selectedCategory = json['selectedCategory'];

    feedsdisableRSS = json['feeds:disableRSS'];
    rssFeedUrl = json['rssFeedUrl'];
    if (json['filters'] != null) {
      filters = [];
      json['filters'].forEach((v) {
        filters?.add(Filters.fromJson(v));
      });
    }
    selectedFilter = json['selectedFilter'] != null
        ? SelectedFilter.fromJson(json['selectedFilter'])
        : null;
    if (json['terms'] != null) {
      terms = [];
      json['terms'].forEach((v) {
        terms?.add(Terms.fromJson(v));
      });
    }
    selectedTerm = json['selectedTerm'] != null
        ? SelectedTerm.fromJson(json['selectedTerm'])
        : null;
    pagination = json['pagination'] != null
        ? Pagination.fromJson(json['pagination'])
        : null;
    loggedIn = json['loggedIn'];
    loggedInUser = json['loggedInUser'] != null
        ? LoggedInUser.fromJson(json['loggedInUser'])
        : null;
    relativePath = json['relative_path'];
    template =
        json['template'] != null ? Template.fromJson(json['template']) : null;
    url = json['url'];
    bodyClass = json['bodyClass'];
    // header = json['_header'] != null ? Header.fromJson(json['_header']) : null;
    widgets =
        json['widgets'] != null ? Widgets.fromJson(json['widgets']) : null;
  }
  num? nextStart;
  num? topicCount;
  List<Topics>? topics;
  List<num>? tids;
  String? title;
  List<Breadcrumbs>? breadcrumbs;
  bool? canPost;
  bool? showSelect;
  bool? showTopicTools;
  String? allCategoriesUrl;
  dynamic selectedCategory;
  num? feedsdisableRSS;
