  LoggedInUser? loggedInUser;
  String? relativePath;
  Template? template;
  String? url;
  String? bodyClass;
  // Header? header;
  Widgets? widgets;
  CategoriesModel copyWith({
    num? nextStart,
    num? topicCount,
    List<Topics>? topics,
    List<num>? tids,
    String? title,
    List<Breadcrumbs>? breadcrumbs,
