        breadcrumbs: breadcrumbs ?? this.breadcrumbs,
        canPost: canPost ?? this.canPost,
        showSelect: showSelect ?? this.showSelect,
        showTopicTools: showTopicTools ?? this.showTopicTools,
        allCategoriesUrl: allCategoriesUrl ?? this.allCategoriesUrl,
        selectedCategory: selectedCategory ?? this.selectedCategory,

        feedsdisableRSS: feedsdisableRSS ?? this.feedsdisableRSS,
        rssFeedUrl: rssFeedUrl ?? this.rssFeedUrl,
        filters: filters ?? this.filters,
        selectedFilter: selectedFilter ?? this.selectedFilter,
        terms: terms ?? this.terms,
        selectedTerm: selectedTerm ?? this.selectedTerm,
        pagination: pagination ?? this.pagination,
        loggedIn: loggedIn ?? this.loggedIn,
        loggedInUser: loggedInUser ?? this.loggedInUser,
        relativePath: relativePath ?? this.relativePath,
        template: template ?? this.template,
        url: url ?? this.url,
        bodyClass: bodyClass ?? this.bodyClass,
        // header: header ?? this.header,
        widgets: widgets ?? this.widgets,
      );
  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['nextStart'] = nextStart;
    map['topicCount'] = topicCount;
    if (topics != null) {
      map['topics'] = topics?.map((v) => v.toJson()).toList();
    }
    map['tids'] = tids;
    map['title'] = title;
    if (breadcrumbs != null) {
      map['breadcrumbs'] = breadcrumbs?.map((v) => v.toJson()).toList();
    }
    map['canPost'] = canPost;
    map['showSelect'] = showSelect;
    map['showTopicTools'] = showTopicTools;
    map['allCategoriesUrl'] = allCategoriesUrl;
    map['selectedCategory'] = selectedCategory;
