    map['rssFeedUrl'] = rssFeedUrl;
    if (filters != null) {
      map['filters'] = filters?.map((v) => v.toJson()).toList();
    }
    if (selectedFilter != null) {
      map['selectedFilter'] = selectedFilter?.toJson();
    }
    if (terms != null) {
      map['terms'] = terms?.map((v) => v.toJson()).toList();
    }
    if (selectedTerm != null) {
      map['selectedTerm'] = selectedTerm?.toJson();
    }
    if (pagination != null) {
      map['pagination'] = pagination?.toJson();
    }
    map['loggedIn'] = loggedIn;
    if (loggedInUser != null) {
      map['loggedInUser'] = loggedInUser?.toJson();
    }
    map['relative_path'] = relativePath;
    if (template != null) {
      map['template'] = template?.toJson();
    }
    map['url'] = url;
    map['bodyClass'] = bodyClass;
    // if (header != null) {
    //   map['_header'] = header?.toJson();
    // }
    if (widgets != null) {
      map['widgets'] = widgets?.toJson();
    }
    return map;
